import React from "react";
import "./Trips.css";
import TripCard from "./TripCard";
import CardImage1 from "../images/5.jpg"
import CardImage2 from "../images/7.jpg"
import CardImage3 from "../images/10.jpg"

export default function Trips() {
    return (
      <div className="trips">
        <h1>Recent Trips</h1>
        <p>You can discover unique destinations using Google Maps</p>
        <div className="cards">
          <TripCard img={CardImage1} heading/>
          <TripCard />
          <TripCard />
        </div>
      </div>
    );
}
